import React,{useContext} from 'react';
import {Link} from 'react-router-dom';
import {Grid, Card, Paper, Container }from '@material-ui/core';
import Typography from '@material-ui/core/Typography';
import {PropertyContext} from '../context/context';
import { makeStyles } from '@material-ui/core/styles';
import ButtonBase from '@material-ui/core/ButtonBase';
import img1 from "../images/room-1.jpeg";
import NumberFormat from 'react-number-format';
import bed from '../images/Vector.svg';
import bath from '../images/Bath.svg';
import hold from '../images/hold.svg';

const useStyles = makeStyles((theme) => ({
    Head:{
        color: "#F9F3FA"
    },
    Paper:{
        background:"#1C191D",
        borderRadius: 15,
        padding: 8
    },
    CardBody:{
        padding: 16,
        borderRadius:15,
        background:" #18121A"
    },
    Image: {
        height: 200,
        borderRadius: 20
    },
    img: {
        height:'100%',
        borderRadius: 20,
        width:"100%",
        margin: 'auto',
        display: 'block',
        maxWidth: '100%',
        maxHeight: '100%',
    },
    Address:{
        color:"#F9F3FA",
        fontWeight: 500,
        fontSize:"0.9rem",
        letterSpacing:"0.04em"
    },
    Price:{
        display:"flex",
        color: "#F9F3FA",
        fontWeight:400,
        fontSize:"1.1rem",
        margin:"12px 0px"
    },
    propText:{
        color:"#B8AFB6"
    },
    svgContainer:{
        display:"flex",
        alignItems:"center"
    }
  }));

export default function PropertyList() {
    const classes = useStyles();
    const context = useContext(PropertyContext)
    const images = context.initialData.map(card => card.images)

    return (
        <Paper className={classes.Paper} >
            <Typography className={classes.Head}>15 Search result</Typography>
            <Grid container spacing={5}>
                {context.initialData.map((card)=>(
                    <Grid item key={card.id} xs={12}  >
                        <Paper className={classes.CardBody} elevation={5}>
                            <Grid container spacing={2} >
                                <Grid item xs={12} sm={4} container>
                                    <Link  to={`/DetailPage/${card.id}`} >
                                        <ButtonBase className={classes.Image}>
                                            <img className={classes.img} alt="complex" src={img1} />
                                        </ButtonBase>
                                    </Link>
                                </Grid>
                                <Grid item xs={12} sm={8} container>
                                    <Grid  container>
                                        <Grid item container direction="column" spacing={2}>
                                            <Grid item >
                                                <Typography component="subtitle1" className={classes.Address}>
                                                    {card.name}
                                                </Typography>
                                                <NumberFormat className={classes.Price} value={card.price} displayType={'text'} thousandSeparator={true} prefix={'£'} suffix={` pcm`}/>
                                                <div style={{display:"flex"}}>
                                                    <div className={classes.svgContainer}>
                                                        <img src={hold}  alt="bed"/>
                                                        <p>{card.Beds}</p>
                                                    </div>
                                                    <div className={classes.svgContainer}>
                                                        <img src={bed}  alt="bed"/>
                                                        <p>{card.Beds}</p>
                                                    </div>
                                                    <div className={classes.svgContainer}>
                                                        <img src={bath}  alt="bed"/>
                                                        <p>{card.Beds}</p>
                                                    </div>
                                                </div>
                                            </Grid>
                                        </Grid>
                                        <Grid item>
                                            {/* <NumberFormat className={classes.Price} value={card.ListPrice} displayType={'text'} thousandSeparator={true} prefix={'$'} /> */}
                                            {/* {card.CountyOrParish} */}
                                        </Grid>
                                        </Grid>
                                    </Grid>
                                </Grid>
                            </Paper>
                    </Grid>
                ))}
            </Grid>
        </Paper>
    )
}
